import '../../estilos/estilos.css'
import { Link } from 'react-router-dom';

type Props={
    item1:String
    item2:String
    item3:String
    item4:String
    item5:String
}

function Menu(item:Props){
    return(
        <div>
            <div><Link to='/home/caminho1'>{item.item1}</Link></div>
            <div><Link to='/home/caminho2'>{item.item2}</Link></div>
            <div><Link to='/home/caminho3'>{item.item3}</Link></div>
            <div><Link to='/home/caminho4'>{item.item4}</Link></div>
            <div><Link to='/home/caminho5'>{item.item5}</Link></div>
        </div>
    )
}

export default Menu;
